INSERT INTO `v1_9fb6fe7c37eac0470f6544c0b286d93e3461fa55e98cf17117f2d6d034deef18` VALUES (513, 11, 0, 5, 0, "ふふ。ボクを呼んでくれて正解だよ。\nこの新年の晴れやかな日にこそ\nボクの輝く美貌が必要だからね！", 100811, 0.5, 513043, 1, 0);
